import React from 'react'
import './Form.css';

const Form = () => {
    const submitHandler = (event) => {
        event.preventDefault()
    }
  return (
    <form onClick={submitHandler}>
        <label>Username</label>
        <input type='text'  />
        <label>Age (Years)</label>
        <input type='number'  />
        <button type='submit'>Add User</button>
    </form>
  )
}

export default Form
